package model;

public class Tipo{
	protected int tipo;
	protected double pct;
	
	
	public Tipo(int tipo, double pct) {
		this.tipo = tipo;
		this.pct = pct;
		// TODO Auto-generated constructor stub
	}

	public int getTipo() {
		return tipo;
	}

	public void setTipo(int tipo) {
		this.tipo = tipo;
	}

	public double getPct() {
		return pct;
	}

	public void setPct(double pct) {
		this.pct = pct;
	}



}
